import React from 'react'
import Login from '../../components/Login';

function LoginPage() {
    return (
        <div>
            <p style={{ backgroundColor: "yellow" }}>login</p>
            <div>loginpage</div>
            <p style={{ backgroundColor: "red" }}>comp</p>
            <div><Login /></div>
        </div>
    )
}

export default LoginPage;
